import { useState } from "react";
import styled from "styled-components";

const Tablerow = styled.div``;

const PostList = () => {
  return (
    <>
      <TableHead></TableHead>
      <Tablerow post={{}} />
    </>
  );
};
export default PostList;

const TableHead = () => {
  return (
    <>
      <div>번호</div>
      <div>제목</div>
      <div>작성자</div>
      <div>작성일</div>
    </>
  );
};
